Description
(after 
Baccaert 1987
; 
Parker 2009
): Test slightly longer than wide, with quinqueloculine chamber arrangement. Test wall porcelaneous with a roughened texture. Rounded aboral end produced. Oral end slightly produced and rounded. Faint longitundal striae give slightly carinate appearance to rounded margins. Distinct sutures depressed. Aperture flush against oral end of final chamber, low arch to circular in outline with a moderately thick, everted lip. Dentition consists of a stout, low, bifurcate tooth.
